import FormUlFlex from "./FormUlFlex";
function UlFlex(props) {
    if (props.heightImage) {
        console.log('bbbbbb')
    }
    const css = {
        body : {
            width: '100%',
            height: 'auto',
            backgroundColor: props.backgroundColor,
            display: 'flex',
            justifyContent: 'center',
            alignItems: 'center',

        },
        ul : {
            width: '70%',
            height: '112px',
            listStyleType: 'none',
            display: 'flex',
            justifyContent: 'space-around',
            alignItems: 'center',
            margin: '0'
        },
        img : {
            height: props.heightImage,

        }



    }


    if (props.count === 4) {
        return (
            <div style={css.body}>
                <ul style={css.ul}>
                    <li><img src={props.img[0]} alt="" style={css.img} /></li>
                    <li><img src={props.img[1]} alt="" style={css.img} /></li>
                    <li><img src={props.img[2]} alt="" style={css.img} /></li>
                    <li><img src={props.img[3]} alt="" style={css.img} /></li>
                </ul>
            </div>
        )
    } else if (props.count === 5) {
        return (
            <div style={css.body}>
                <ul style={css.ul}>
                    <li><img src={props.img[0]} alt="" style={css.img} /></li>
                    <li><img src={props.img[1]} alt="" style={css.img} /></li>
                    <li><img src={props.img[2]} alt="" style={css.img} /></li>
                    <li><img src={props.img[3]} alt="" style={css.img} /></li>
                    <li><img src={props.img[4]} alt="" style={css.img} /></li>
                </ul>


            </div>
        )
    } else if (props.count === 6) {
        return (
            <div style={css.body}>
                <ul>
                    <li><img src={props.img[0]} alt="" style={css.img} /></li>
                    <li><img src={props.img[1]} alt="" style={css.img} /></li>
                    <li><img src={props.img[2]} alt="" style={css.img} /></li>
                    <li><img src={props.img[3]} alt="" style={css.img} /></li>
                    <li><img src={props.img[4]} alt="" style={css.img} /></li>
                    <li><img src={props.img[5]} alt="" style={css.img} /></li>
                </ul>


            </div>
        )
    } else {
        console.log('ERROR IN UlFlex.js')
    }


}
export default UlFlex;
